import './index.css';
import { Item } from './tetris.js';

import mainLogo from './Tetris_T.png';



class Square extends React.Component{
  constructor(props){
    super(props);
  }

  render() {
    return(
      <div>

      </div>
    )
  }
}

class App extends React.Component{
    render() {
      return(
        <div>
          <Item />
          <Item />
          <hr id="divide"></hr>
        </div>
      )
    }
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
